    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public function handle()
    {
        $tickers = [];
        foreach ($this->getCompanyList() as $company) {
            $tickers[] = $company->Symbol;
        }
        // print_r($tickers);
        // Balance Sheet
        foreach ($tickers as $ticker) {
            if ($ticker <= 'ADP') {
                continue;
            }

            $bsfys = $this->getBalanceSheet($ticker);
            $bsfys += $this->getBalanceSheetFullYear($ticker);

            foreach ($bsfys as $rkey => $value) {
                $sendBalanceSheet = [];
                $milestones = [];

                $sendBalanceSheet['balanceSheet'] = $value;
                if (empty($sendBalanceSheet['balanceSheet']) || empty($sendBalanceSheet['balanceSheet']['F2_1'])) {
                    continue;
                }
                $sendBalanceSheet['ticker'] = $ticker;

                if (strpos($rkey, '_q') === false) {
                    $milestones['balanceSheet'] = $rkey . '_q5';
                } else {
                    $milestones['balanceSheet'] = $rkey;
                }

                $this->sendData((object)$sendBalanceSheet, $milestones);
            }
        }
    }

    public function sendData($result, $milestones = [])
    {
        $sendData = [];
        foreach ($result as $key => $value) {
            if (!empty($value)) {
                // $milestones_time = date('Y-m-d', time());
                $milestones_time = 9999;
                if (!empty($milestones[$key])) {
                    $milestones_time = $milestones[$key];
                }
                // TODO: Bỏ selected = true
                $sendData[] = (object)array(
                    'table' => 'company',
                    'code' => $result->ticker,
                    'field_name' => $key,
                    'milestones_time' => $milestones_time,
                    'values' => [(object)['source' => 'CAFEF', 'value' => $value, 'selected' => true]]
                );
            }
        }

        $sendFinal = (object)array('data' => $sendData);

        $curl = curl_init();
        curl_setopt_array($curl, array(
            CURLOPT_URL => env('RAW_DB_API') . '/line/save-multiple',
            CURLOPT_RETURNTRANSFER => true,
            CURLOPT_ENCODING => '',
            CURLOPT_MAXREDIRS => 10,
            CURLOPT_TIMEOUT => 10,
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            CURLOPT_CUSTOMREQUEST => 'POST',
            CURLOPT_POSTFIELDS => json_encode($sendFinal),
            CURLOPT_HTTPHEADER => array(
                'Content-Type: application/json'
            ),
        ));

        $response = curl_exec($curl);

        curl_close($curl);
        // echo $response;
        echo 'Đã lưu công ty ' . $result->ticker . "\n";
    }


    public function getBalanceSheet($ticker): array
    {
        $result = [];
        for ($i = 0; $i < 20; $i++) {
            $year = intval(date("Y", time())) - $i;
            $url = 'https://s.cafef.vn/bao-cao-tai-chinh/' . $ticker . '/BSheet/' . $year . '/4/-10/1/1/bao-cao-tai-chinh-cong-ty-co-phan-fpt.chn';
            do {
                $dataText = $this->sendRequest($url);
            } while (str_contains($dataText, "The service is unavailable"));

            $parseResult = $this->parseBalanceSheet($dataText);

            for ($j = 1; $j <= 4; $j++) {
                if (isset($parseResult['Quý' . $j . '-' . $year])) {
                    $result[$year . '_q' . ($j)] = $parseResult['Quý' . $j . '-' . $year];
                }
            }
        }

        return $result;
    }

    public function getBalanceSheetFullYear($ticker): array
    {
        $result = [];
        for ($i = 0; $i < 5; $i++) {
            $year = (int)date("Y", time()) - $i * 4;
            $url = 'https://s.cafef.vn/bao-cao-tai-chinh/' . $ticker . '/BSheet/' . $year . '/0/0/1/0/bao-cao-tai-chinh-cong-ty-gi-do.chn';
            do {
                $dataText = $this->sendRequest($url);
            } while (str_contains($dataText, "The service is unavailable"));

            echo time() . ' ' . $url;
            $result = $result + $this->parseBalanceSheet($dataText);
        }
        return $result;
    }

