    public function sendRequest($url, $method = 'GET', $header = array())
    {
        echo "\n Sending requets " . $url . "\n";
        // Throttle 1s per request
        if (time() - $this->lastRequest < 2) {
            sleep(1);
        }
        $this->lastRequest = time();

        $curl = curl_init();
        $sendHeader = array(
            'Connection: keep-alive',
            'User-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/87.0.4280.88 Safari/537.36',
            'Accept: */*',
            'Sec-Fetch-Site: cross-site',
            'Sec-Fetch-Mode: no-cors',
            'Sec-Fetch-Dest: script',
            'Referer: https://s.cafef.vn/',
            'Accept-Language: vi,vi-VN;q=0.9,fr-FR;q=0.8,fr;q=0.7,en-US;q=0.6,en;q=0.5'
        );
        $sendHeader = array_merge($sendHeader, $header);

        curl_setopt_array($curl, array(
            CURLOPT_URL => $url,
            CURLOPT_RETURNTRANSFER => true,
            CURLOPT_ENCODING => '',
            CURLOPT_MAXREDIRS => 10,
            CURLOPT_TIMEOUT => 30,
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            CURLOPT_CUSTOMREQUEST => $method,
            CURLOPT_HTTPHEADER => $sendHeader
        ));

        $response = curl_exec($curl);

        curl_close($curl);
        return $response;
    }
